import React, { useState } from "react";
import "./App.css";
import InputBox from "./InputBox";

function App() {
  const [ticketList, setTicketList] = useState([]);

  return (
    <div className="App">
      <h1 className="title">Ticket Entry System</h1>

      <div className="TicketEntryBody">
        <InputBox />
        <div className="displaybox"></div>
      </div>
    </div>
  );
}

export default App;
